import React from 'react'
import './content.css';
import video from "../images/video.png"


export default function content() {
    return (
        <div className='content'>
            <h1 className='content-heading'>Week 1 | Form and Technique</h1>
            <div className='row'>
                <div className='video'>
                    <img src={video} alt='img'></img>
                </div>
            </div>



        </div>
    )
}
